var Coordinatesnotworking =[Argentina, Australia, Chile, NewZealand, Philippines, Turkey, UnitedStatesofAmerica, China, France, Greece, Indonesia];

// #Push Features that Did not Have Working Coordinates
for (i = 0; i < Coordinatesnotworking.length; i++) {
    Countrypoly.push({
    "type": "Feature",
    "properties": {"produce": Produce[indexnotworking[i]], "guacamole": Guacamole[indexnotworking[i]], "country": Country[indexnotworking[i]]},
    "geometry": {
        "type": "Polygon",
        "coordinates": Coordinatesnotworking[i]}
    })};

    var layer = new L.geoJSON(Countrypoly, {
    style: function(feature) {
        switch (feature.properties.guacamole) {
            case 'Yes': return {color: "#ff0000"}}},
    onEachFeature: function (feature, layer) {
      layer.on('mouseover', function () {
        this.setStyle({
            'weight': '5'
          });
      });
      layer.on('mouseout', function () {
        this.setStyle({
          'weight': '1'
        });
      });
      layer.on('click', function onMapClick(feature) {
        // Let's say you've got a property called url in your geojsonfeature:
        popup
        .setLatLng(feature.latlng)
        .setContent(feature.country)
        .openOn(map);
      });
      
    }
  }).addTo(map);

